import { Position } from 'reactflow';
import { BaseNode } from './BaseNode';

export const AlertNode = ({ id }) => {
  return (
    <BaseNode 
      id={id} 
      label="Alert" 
      handles={[{ type: 'target', position: Position.Left, id: 'msg' }]}
    >
      <span style={{ fontSize: '12px' }}>Triggers a browser popup.</span>
    </BaseNode>
  );
};
